    | "if"      -> IF
    | "int"     -> INT
    | "float"   -> FLOAT
    | "null"    -> NULL
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID 
    | "do"      -> DO
    | "case"    -> CASE    
    | "switch"  -> SWITCH   
